sourcesContent:
document.getElementById("checkbox").addEventListener("click", () => {
  var navManu = document.getElementById("navmanu");
  if (navManu.style.display === "block") {
    navManu.style.display = "none";
  } else {
    navManu.style.display = "block";
  }
});
